% Define harmonic coefficients
A_0 = [1.5 1; 1 -0.5];
A_1 = [-4/pi^2 1/2; 0 1/(pi*1i)];
A_2 = [0 0; 1i/2 0];
A_3 = [4/(3*pi)^2 0; 0 1/(pi*3*1i)];

% Create PhasorArray with all harmonics (negative to positive)
A = PhasorArray(cat(3,conj(A_3), conj(A_2), conj(A_1), A_0, A_1, A_2, A_3));
% Equivalently for real signal:
A = PhasorArray(cat(3, A_0, A_1, A_2, A_3),"isreal",true) %[output:85c1e23f]
%%
T = 1; %period
N = 6; %2^N points used for FFT 
At = @(t) [1+sawtooth(2*pi*t/T,0.5)+0.5, 1+cos(2*pi*t/T); 1-sin(2*2*pi*t/T), -0.5 + square(2*pi*t/T)/2];
A = PhasorArray.funcToPhasorArray(At,T,N) %[output:6ee26bb4] %[output:7d48e6cb]
%%
% Harmonic spectrum visualization (stem plot)
figure  %[output:0e5d2332]
stem(A,"scale","linear","uniformYLim",0) %[output:0e5d2332]
sgtitle('stemplot of phasor of A(t)') %[output:0e5d2332]

% Time-domain reconstruction over multiple periods
figure %[output:960c8664]
plot(A) %[output:960c8664]
sgtitle('time evolution of A(t) over one period') %[output:960c8664]
%%
% Neglect small harmonics (threshold-based filtering)
A_neglect = neglect(A{2,2}, 2.e-2, 'reduceMethod', 'absolute');
% Truncate to fixed harmonic order
A_trunc = trunc(A{2,2}, 5);
figure %[output:1e4008a6]
stem(A{2,2}, 'scale', 'log') %[output:1e4008a6]
hold on %[output:1e4008a6]
stem(A_neglect, 'Marker', 'x') %[output:1e4008a6]
stem(A_trunc, 'Marker', '<') %[output:1e4008a6]
legend('PhasorArray','Neglected Phasors','Truncated Phasors') %[output:1e4008a6]
title('Harmonic content (log scale)') %[output:1e4008a6]
xlabel('Harmonic'), ylabel('Magnitude') %[output:1e4008a6]
figure %[output:9faf9284]
plot(A{2,2}, T, [0, 2*T]) %[output:9faf9284]
hold on %[output:9faf9284]
plot(A_neglect, T, [0, 2*T]) %[output:9faf9284]
plot(A_trunc, T, [0, 2*T]) %[output:9faf9284]
t=0:.01:2*T;
A_eval = arrayfun(@(t) At(t), t, 'UniformOutput', false);
catA_eval = cat(3, A_eval{:});
plot(t, squeeze(catA_eval(2,2,:)), 'k--') %[output:9faf9284]
legend('PhasorArray', 'Neglected Phasors', 'Truncated Phasors', 'Original Signal') %[output:9faf9284]
title('Square wave'), xlabel('Time (s)'), ylabel('Amplitude') %[output:9faf9284]
%%
% Generate random periodic matrix
B = PhasorArray.random(2, 2, 2) %[output:24df0c49]
% 2x2 with 2 harmonics

% Algebraic operations (computed in harmonic domain)
   % Equivalence in the time domain
C = A + B;  % Addition: C(t) = A(t) + B(t)
D = A * B;  % Multiplication: D(t) = A(t)*B(t)
Ainv = inv(A); % Inversion: Ainv(t) = A(t)^{-1}
At = A.';  % Transpose
Ah = A';  % Transpose conjugate
%%
% Create  Toeplitz-Block form truncated to h=8 harmonics
h = 8;
A_tb = A.T_tb(h); % Toeplitz-Block form (full matrix)
% Visualize the structure
figure %[output:183499b9]
barsurf(abs(A_tb),1e-3);  %[output:183499b9]
title('T(A)_8'); %[output:183499b9]
%%
A_four = F_tb(A,h) % Fourier form of PhasorArray A  %[output:0b00ee05]
%%
% For system with state dimension n=2 and period T=1
T = 1;
h = 10; % Truncation order
% Construct N operator in Toeplitz-Block form
Ntb = N_tb(size(A,1), h, T); 
%%
lambda = A.HmqNEig(h,T,"fundamental") %[output:5558af3e]
%%
Q = PhasorArray.eye(2); % Positive definite Q(t)
P = lyap(A,Q,"T",T); %[output:6d0dd198]
%%
t=0:0.1:T;
Pt = evalTime(P,T,t);
%%
B = [1;PhasorArray.sin] %[output:65fcc431]
Q = PhasorArray.eye(2)*0.1;
R = PhasorArray.eye(1)*100;
K0 = PhasorArray([10,10]);
htrunc = 6; %initial truncation order for Riccati solution

[K_final, S_final] = RicHarmonicKlein(A, B, Q, R, K0,T,"autoUpdateh",true,"max_iter",50,"residualThreshold",1e-8,"htrunc",htrunc,"hmax",500) %[output:35d83905] %[output:9440bdbd] %[output:90dac14e]
%%
eig_closedloop=HmqNEig(A-B*K_final,20,T,"fundamental") %[output:9ed5ffee]
%%
% TBLMI LQR Optimization Problem
hlmi = 20; %truncation order for LMI
hP = 20; %truncation order for P in LMI
ht = 20; %truncation order for A in LMI
% Define decision variable (periodic P via harmonics)
P = PhasorArray.ndsdpvar(2, 2, hP);
% Formulate LMI components
LMIvar11 = trunc(A,ht).'*P + P*trunc(A,ht)+ P.d(T) + Q; %[output:4387c73b] %[output:0b10bd6d] %[output:2432082c]
LMIvar12 = P*B;
LMIvar22 = R;
% Convert to Toeplitz-Block form
P_tb = P.T_tb(hlmi); 
LMI_tb = [T_tb(LMIvar11, hlmi) , T_tb(LMIvar12, hlmi);
 T_tb(LMIvar12.', hlmi), T_tb(LMIvar22, hlmi)];
% Solve: maximize trace(P_0) subject to constraints
Constraints = [P_tb >= 0, LMI_tb >= 0];
Objective = -trace(P{:,:,0});%use P{i,j,k} to access kth phasor of P_{i,j}
sol = optimize(Constraints, Objective); %[output:9338d29a]
%%
Psol = sdpval(P); % Extract solution as PhasorArray
K=inv(R)*B'*Psol % Optimal feedback
% Compare solutions
figure
plot(Psol, T, 0:T/100:T);
hold on;
plot(S_final, T, 0:T/100:T)
figure
plot(K, T, 0:T/100:T)
hold on;
plot(K_final, T, 0:T/100:T)
%%
% Create LTP state-space system
C = PhasorArray.eye(2);
D = PhasorArray.zeros(2, 2);
sys = PhasorSS(A, B, C, D, T);
% Closed-loop system
sys_cl = feedback(sys, K_final);

figure
plot(sys_cl) %plot of matrix [A-BK,B;C,-DK]
%%
% Simulate initial condition response
x0 = [1; 1];
t_sim = 0:T/100:5*T;

figure
initial(sys_cl, x0, t_sim);
title('Closed-loop response (initial condition)')
figure
u= [1+PhasorArray.cos];
[y,t]=lsim(sys_cl,t_sim,u,x0);
plot(t,y);
title('Closed-loop response')

%%
hlmi = 20
hP = 20
P2 = PhasorArray.ndsdpvar(2,2,hP);
W = PhasorArray.ndsdpvar(1,1,hP) ;
Y =  PhasorArray.ndsdpvar(1,2,4*hP,'real',true,'PhasorType','full');
R12 = neglect((R^(1/2)));
gam = sdpvar(1,1);
Ntba = N_tb(A,hlmi,T);
Ptb_2 = T_tb(P2 , hlmi);

DP_tb = (-Ntba*Ptb_2) + Ptb_2*(-Ntba');
%DP_tb = -T_tb(P2.d(T),hlmi)

LMI{1} = -Q*P2 - W ;
LMI{2} = [W (R12)*Y;
    Y.'*(R12) P2];
LMI{3} = -A*P2 + -P2*A.' + B*Y + Y.'*B.' - eye(2)  - (-P2.d(T));
Constraint = [
trace(phas(LMI{1},0))+gam>=0 ; 
T_tb(LMI{2} , hlmi)>=0 ;
T_tb(LMI{3} , hlmi)>=0 ;
Ptb_2>=0  ];
% Solve the LMI problem
sol = optimize(Constraint, gam);
%%

hYpost=60
hPpost=20
KK = trunc(sdpval(Y),hYpost)/trunc(sdpval(P2),hPpost)

figure
stem(KK.trunc(20))
hold on
stem(K_final.trunc(20))

figure
plot(KK)
hold on
plot(K_final)
%%

figure
plot((sdpval(A.'*P2 + P2*A + P2.d(T) - P2*B * inv(R)*B.'*P2 + Q)))
figure
plot((sdpval((A-B*KK).'*P2 + P2*(A-B*KK) + P2.d(T) + Q + KK.'*R*KK)))


figure
plot(sdpval(P))
hold on
plot((sdpval(P2)))

figure
plot(HmqNEig(A-B*KK,hlmi),'*')
hold on
plot(HmqNEig(A-B*K_final,hlmi),'o')

%%

P2_ttb = T_tb(sdpval(P2),hlmi);
Y_ftb  = F_tb(sdpval(Y),hlmi);
x0 = zeros(size(Y_ftb));

ksdp = PhasorArray.ndsdpvar(1,2,hlmi)
Constraint = []
kpY = ksdp*sdpval(P2)-sdpval(Y)
ken = 0
kenreg = 0
lambda_Tik = 0.1
for ii = 0:kpY.h
    ken = ken + kpY{:,:,ii}.*kpY{:,:,-ii} ;
    kenreg = kenreg  + ii*ii*sum(ksdp{:,:,ii}.*ksdp{:,:,-ii},'all');
end
ken
%%
lambda_Tik = 0.5
optimize(Constraint,sum(ken,'all')+lambda_Tik * sum(kenreg,'all') )


figure
clf
stem(K_final.trunc(20))
hold on
stem(sdpval(ksdp))
stem(KK.trunc(20))

